    constructor(props) {
        super(props);

        this.state = {
            partners : PARTNER_DATA
        }
    }
    render() {
        const { partners } = this.state;
        return (
            <div>
                <div className='md:ml-24 mt-4 text-indigo-400 text-center text-bold text-4xl font-medium'> 
     Partners</div>
     <p className='md:ml-24 text-center text-gray-600 text-lg md:text-base font-thin'>
         Lorem ipsum dolor sit amet consectetur adipisicing elit. Laudantium totam omnis distinctio beatae sunt aliquam explicabo, asperiores perspiciatis quos deleniti reiciendis sit molestias architecto maiores vitae accusamus. Illum, quod voluptatem.</p>
            <div className='md:flex md:ml-64 md:pl-24'>
               {partners.map(({name,number,id,imageUrl}) => (
                   <PartnerCard key={id} number={number} name={name} imageUrl={imageUrl}/>
               ))
               }
            </div>
            <div className='md:ml-24 mb-4 text-blue-500 text-center text-bold text-4xl font-medium'> 
     E-Mail: rkec@airtelmail.in</div>
            </div>
        )
    }
}

export default PartnerList;
